import MSFTTextField, { TextFieldAppearance, } from "./text-field";
import textFieldSchema from "./text-field.schema";
import { TextFieldType } from "@microsoft/fast-components-react-base";
import manageJss from "@microsoft/fast-jss-manager-react";
import { TextFieldStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const TextField = manageJss(TextFieldStyles)(MSFTTextField);
export { TextField, TextFieldAppearance, textFieldSchema, TextFieldType, };
